import React, { Component } from 'react'
import {ProductConsumer} from '../../contextAPI';

export default class CheckoutList extends Component {
    render() {
        return (
            <div className="form-wrapper">
                <ProductConsumer>
                    {value => {
                        const {cart} = value;
                        cart.map((item,index) => {
                            return <h1>{item.name}</h1>
                        })
                    }}
                </ProductConsumer>
            </div>
        )
    }
}
